import React from "react";
import "./DataUpload.css"; // Ensure this is in the same folder

const DataUpload = () => {
  return (
    <div className="data-upload">
      <h2>Data Upload</h2>
      <p>Upload your data here.</p>
      {/* Your Data Upload Content */}
    </div>
  );
};

export default DataUpload;
